import React from "react"
import {PostItem,PostImg} from "./styles/poststyle"
import TimeAgo from 'timeago-react'
const Post = ({item}) =>{
return(
    <PostItem>
    <PostImg src = {item.photo} />
    <TimeAgo datetime = {item.createdAt}  
     />
    </PostItem>
)
}
export default Post
